import React, { useState } from 'react';


export default function Content(props){

    const [state1,chstate1] = useState(true);
    const [state2,chstate2] = useState(false);
    const [state3,chstate3] = useState(false);

    return(
        <>
           <div className={"content "} id={props.id} style={{
               width:"9%",
               height:"8vh",
               border:"1px solid gray",
               display:"flex",
               justifyContent:"center",
               alignItems:"center",
               fontSize:"15px",
               fontWeight:"800",
               borderRadius:"10px",
               cursor:"pointer",
               marginRight:"20px",
               transition:"all 0.6s ease"
           }}  onClick={()=>{
               if(props.id === 1)
               {
                   chstate1(false);
                   chstate2(true);
                   chstate3(false);
               }
               else if(props.id === 2){
                chstate1(false);
                chstate2(false);
                chstate3(true);
               }
           }}>
                 {props.text}
           </div>
        </>
    )
}
